import React from 'react';
import { render } from "react-dom" 
import { Grid } from './models/grid';
import { GridView } from './components/gridView';

const grid = new Grid();
grid.testGrid();
for (let i = 0; i < 10; i++) {
    console.log(String(grid.squares[0][i]))
}

render(
    <div>
        Hello
        <GridView grid={grid}/>
    </div>



, document.getElementById("root"));
